function [BModel,BInliers,BOutliers,BError]=Rsac(data,ThError,SS,d,iter)
%data=input data
%ThError=threshhold error rate
%SS=sample size
%d=threshhold distance
%iter=iterations
syms inliers outliers ni n0;

BModel=[];
BInliers=[];
BOutliers=[];
BError=inf;  

for i=1:iter
    randomP=randperm(SS);
    p1=[data(1,randomP(1)),data(2,randomP(1))];
    p2=[data(1,randomP(2)),data(2,randomP(2))];
    inliers=[];
    outliers=[];
    ni=0;
    n0=0;
    a_model=(p1(2)-p2(2))/(p1(1)-p2(1));
    b_model=p1(2)-a_model*p1(1);
    TError=0;
    for p=1:SS
        point=data(:,p);
        err=abs(data(1,p)*a_model+b_model-data(2,p))/sqrt(a_model^2+1);
        if(ThError<err)
            outliers(:,n0+1)=point;
            n0=n0+1;
        else 
            TError= TError + err;
            inliers(:,ni+1)=point;
            ni=ni+1;
        end
    end
    % check model
    if (BError>TError&&d<ni)
        BModel=[a_model,b_model];
        BInliers=inliers;
        BOutliers=outliers;
        BError=TError;
    end
end 
return;
end

def get_zero_matrix(m, n):
    out = [[0 for i in range(n)] for k in range(m)]
    return out



def transpose_matrix(ls):
    m, n = len(ls), len(ls[0])
    transpose = get_zero_matrix(n, m)

    for k in range(len(ls)):
        for i in range(len(ls[0])):
            transpose[i][k] = ls[k][i]

    return transpose

