def clean_string(s):
    punc = '''.,?';'''
    text = s.lower()
    for char in text:
        if char in punc:
            text = text.replace(char, "")
    return text.split()

text = "'Why?', Muriel asked."
words = clean_string(text)
print(words)

def get_average_sublist(ls,n): 
    if n > (len(ls)-1):
        return None
    if n <= (len(ls)-1):
        ls1 = ls[n]
        s = 0
        for i in ls1:
            s = s + i
        avg = s/len(ls1)
        return round(avg,1)

