def get_zero_matrix(m, n):
    ls = []
    for i in range(m):
        ls.append([])
        for j in range(n):
            ls[i].append(0)
    return ls

def transpose_matrix(A):
    empty = get_zero_matrix(A[0][-1], len(A))
    for sls in A:
        for i in range(len(sls)):
            empty[i][0] = A[0][i]
            empty[i][1] = A[1][i]
    return empty

A = [ [1 ,  2, 3 ] ,
      [40, 50, 60] ]
print(transpose_matrix(A))
